import org.apache.spark.sql.expressions.Window
val w = Window.partitionBy("Tool").orderBy("time")

val lagCol = lag(col("time"), 1).over(w)

val leadCol = lead(col("time"), 1).over(w)
val sendorDFWindowed = unmatchSensorDF.withColumn("previous_value", lagCol).withColumn("next_value", leadCol).na.fill(1)

