%spark2.spark

val gapFilledDF = sendorDFWindowed.join(unmatchFaultsDF, sendorDFWindowed("Tool") === unmatchFaultsDF("Tool") && 
                  sendorDFWindowed("time") < unmatchFaultsDF("time")  && 
                  sendorDFWindowed("next_value") > unmatchFaultsDF("time") , joinType="left_outer")
                  .drop(sendorDFWindowed("previous_value")).drop(sendorDFWindowed("next_value")).drop(unmatchFaultsDF("Tool")).drop(unmatchFaultsDF("time"))

gapFilledDF.createOrReplaceTempView("gapFilledDF")


